import React from 'react';




class App extends React.Component {
  render() {
    
      {if(test == 1){
        return (
          <div className="App">
        <p>Hello</p>
        </div>
        )
      }else if(test ==2){
        return (
            <div className="App">
          <p>World</p>
          </div>
          )
        
      }else{
        return (
            <div className="App">
          <p>Dupa</p>
          </div>
          )
      }
      }
  }
}

export default App;
